class Dex_creator:
	def __init__(self):   
		self.version_major = 1
		self.version_minor = 0
        #path variables
		self.rom_folder_path = ''
		self.game = ''
		self.game_text_path = ''
        
		self.pokemon_name_loading_option = ''
        
        #for loading custom Pokemon names (not present in USUM, not required in XYORAS)
        #this pulls in output from my forme insertion tool
		self.insertion_output_list = ''
        #allows use of just a custom text file if desired
		self.text_file_name_list = ''

        #need this only for XY/ORAS
		self.extracted_egg_moves_folder_path = ''
        

		#header variables
		self.pokemon_data_table_pointers = []
		self.max_nat_dex = 0
		self.max_personal_index = 0
        
        #name array variables
		self.pokemon_names = [] #00 terminator
		self.forme_names = [] 
        
		self.type_names = []
        
		self.ability_names = []
		self.ability_descriptions = []
        
		self.dex_data = []
        
		self.item_names = []
		self.item_descriptions = []
        
		self.move_names = []
		self.move_descriptions = []
        
		self.trainer_classes = [] #first entry is NOT empty
		self.trainer_names = []
		
        
	def pkhex_personal_file(self):
		match self.game:		
			case 'XY':	
				return('personal_xy')
			case 'ORAS':	
				return('personal_ao')
			case 'SM':	
				return('personal_sm')
			case 'USUM':	
				return('personal_uu')
		   
	def pkhex_levelup_file(self):
		match self.game:		
			case 'XY':	
				return('lvlmove_xy.pkl')
			case 'ORAS':	
				return('lvlmove_ao.pkl')
			case 'SM':	
				return('lvlmove_sm.pkl')
			case 'USUM':	
				return('lvlmove_uu.pkl')

		#text file locations
	def gametext_file_number(self, target):
		match target:
			case 'ability_descriptions':			
				match self.game:		
					case 'XY':	
						return(33)
